import React from 'react';
import './drumpad.css';

class Drumpad extends React.Component {
    constructor(props){
        super(props);
        this.state = {
            q: "Q",
            w: 'W',
            e: "E",
            a: "A",
            s: "S",
            d: "D",
            z: "Z",
            x: "X",
            c: "C"
        }
      }

      changeTitle = () => {
          this.setState({ w: "High Clap" });
      };

    render() {
        return (
            <div id="display">
                <div className="drum-pad" id="q">
                    <audio src='' className="clip" id='q' />{this.state.q}
                </div>
                <div className="drum-pad" id="w">
                    <audio src='' className="clip" id='w' />{this.state.w}
                    </div>
                <div className="drum-pad" id="e">
                <audio src='' className="clip" id='q' />{this.state.q}
                    </div>
                <div className="drum-pad" id="a">A</div>
                <div className="drum-pad" id="s">S</div>
                <div className="drum-pad" id="d">D</div>
                <div className="drum-pad" id="z">Z</div>
                <div className="drum-pad" id="x">X</div>
                <div className="drum-pad" id="c">C</div>
            </div>
        )
    }
}

export default Drumpad
